import React from "react";
import ReactDOM from "react-dom/client";
function App() {
  return (
    <div
      style={{
        border: "2px solid lightblue",
        borderRadius: "5px",
        textAlign: "center",
        fontFamily: "Calibri",
      }}
    >
      <h2>Log in</h2>
      <hr style={{ color: "grey" }}></hr>
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

